import Sort from "./Sort";
import Morning from "./Morning";
import Afternoon from "./Afternoon";
import Evening from "./Evening";
import Night from "./Night";

const TabBlcok = () => {
  return (
    <div>
      <Morning />
      <Afternoon />
      <Evening />
      <Night />
      <div>
        <Sort />
      </div>
    </div>
  );
};

export default TabBlcok;
